input, option, select, textarea {
    background-color: white;
    color: #444;
    border-radius: 3px;
    border-width: 1px;
    border-style: solid;
    border-color: #888;
}

body {
    border: none !important;
    font-family: "Lucida Sans Unicode", "Lucida Grande", sans-serif !important;
    font-size: 21px !important;
    background: #D9D7D3 !important;
}

#content {
    margin: 0 auto !important;
    border: none !important;
    max-width: 860px !important;
    background: #D9D7D3 !important;
}

a {
    text-decoration: none !important;
}
a:hover {
    text-decoration: underline !important;
}



/* top nav */
#mw-page-base {
    z-index: 10 !important;
    height: 90px !important;
    margin: 0 auto !important;
    background: #CAC8C4 !important;
}

#mw-navigation {
    position: absolute !important;
    top: 0 !important;
    left: 0 !important;
    right: 0 !important;
}

#mw-head {
    position: relative !important;
    max-width: 923px !important;
    height: 90px !important;
    margin: 0 auto !important;
}

#mw-head a,
#mw-head ul,
#mw-head li,
#mw-head span,
#mw-head .vectorTabs {
    background: none !important;
    border: none !important;
}

#mw-head > * {
    position: absolute !important;
    font-size: 16px !important;
    margin: 0 !important;
    padding: 0 !important;
}

#mw-head #left-navigation {
    top: 50px !important;
    left: 29px !important;
    padding: 0 !important;
}
#mw-head #right-navigation {
    top: 50px !important;
    right: 0 !important;
    padding: 0 !important;
}
#mw-head #p-personal {
    top: 0px !important;
    right: 0 !important;
    padding: 5px 30px 0 0 !important;
    font-size: 14px !important;
}

#mw-head li {
    opacity: 0 !important;
    transition: all 0.45s ease-out !important;
}
#mw-head:hover li {
    opacity: 1 !important;
    transition: all 0.13s ease-in !important;
}

#mw-head a,
#mw-head a:visited {
    color: #556 !important;
}

#mw-head #searchform > div {
    position: absolute !important;
    z-index: 90 !important;
    top: -32px !important;
    right: 30px !important;
    margin-top: 13px !important;
    margin-left: 15px !important;
    border: none !important;
    width: 350px !important;
    padding: 0 0 10px !important;
}

#mw-head #searchform > div input#searchInput {
    background: #E8E6E2 !important;
    padding: 8px 0 6px 8px !important;
}

#mw-head #p-cactions,
#mw-head #ca-watch {
    display: none !important;
}



/* logo */
#mw-head:before {
    position: relative !important;
    width: 100px !important;
    height: 100px !important;
    top: 31px !important;
    left: 33px !important;
    content: 'Wikipedia' !important;
    font-family: Times, Garamond !important;
    font-weight: normal !important;
    font-size: 26px !important;
    text-transform: uppercase !important;
    letter-spacing: 0px !important;
    color: #000 !important;
}



/* left nav */
#mw-navigation #mw-panel {
    position: fixed !important;
    z-index: 999 !important;
    font-size: 18px !important;
    top: 0px !important;
    left: -255px !important;
    width: 190px !important;
    height: 100% !important;
    overflow-y: auto !important;
    padding: 0 0 0 100px !important;
    background: #E8E6E2 !important;
    box-shadow: 1px 0 3px rgba(0, 0, 0, 0.25) !important;
    transition: all 0.66s ease-in-out !important;
    opacity: 0 !important;
}

#mw-navigation #mw-panel:hover {
    left: -100px !important;
    transition: all 0.2s ease-in-out !important;
    opacity: 1 !important;
}


#mw-navigation #mw-panel a {
    color: #445 !important;
}

#mw-navigation #p-navigation,
#mw-navigation .first {
    margin-bottom: 0 !important;
    margin-top: 7px !important;
}

#mw-navigation #p-lang:before {
    content: "" !important;
    font-size: 0 !important;
    display: inline-block !important;
    height: 0px !important;
    width: 100% !important;
    border-top: 1px solid rgba(0, 0, 0, 0.2) !important;
    border-bottom: 1px solid rgba(255, 255, 255, 0.75) !important;
}

#mw-navigation #p-lang {
    margin-top: -15px !important;
}

#mw-navigation #p-lang .uls-settings-trigger {
    margin-right: 8px !important;
    margin-top: 6px !important;
}

#mw-navigation > #mw-panel > div:not(#p-lang):not(#p-navigation):not(.first),
#mw-navigation #p-lang .wbc-editpage {
    display: none !important;
}



